import React, {useState} from 'react'

import imgSource from './resources/treeview.png';

const MainButton = (props) => {
    const [btnImage, setBtnImage] = useState([imgSource])
    const [onMouseOverValue, setonMouseOverValue] = useState([false])
    const className = onMouseOverValue ? "Main-button-class" : "disabled"

    return(
        <picture className={className}>
            
            <img src={props.source} width={'300px'} height={'auto'}/>
            <h4>{props.title}</h4>            
            <h3>{props.description}</h3>            
        </picture>
    );
};

export default MainButton;
